CREATE FUNCTION public.capacityforrestaurants() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE cap integer:=(
    SELECT coalesce(SUM(tables.capacity),0)
    FROM tables
    WHERE New.UserID = tables.UserID
    AND NEW.location = tables.location
);
BEGIN 
